  CoinModel.fromJson(dynamic json) {
    _status = json['status'];
    _data = json['data'] != null ? Data.fromJson(json['data']) : null;
  }
  String? _status;
  Data? _data;
  CoinModel copyWith({
    String? status,
    Data? data,
  }) =>
      CoinModel(
        status: status ?? _status,
        data: data ?? _data,
      );
  String? get status => _status;
  Data? get data => _data;

